import React from "react";
import {LINKS_NAV, PATH_LOGIN, PATH_LOGOUT} from "../config/config_nav";
import {NavLink} from "react-router-dom";

const Navigation = () => {

    const itemNavigation = LINKS_NAV.map(link => {
        if(link.path === PATH_LOGIN){
            return <NavLink key={link.path} className="nav__link-btn" to={link.path}>
                <span className="nav__link-title">{link.label}</span>
            </NavLink>
        } else if (link.path === PATH_LOGOUT){
            return "";
        }
        return <NavLink key={link.path} className="nav__link" to={link.path}>
                <span className="nav__link-title">{link.label}</span>
                <div className="nav__link-strip"></div>
            </NavLink>


    })
    return <React.Fragment>
        <div className="nav">
                {itemNavigation}
        </div>
    </React.Fragment>
}
export default Navigation;
